// SPDX-License-Identifier: MIT
pragma solidity >=0.8.22;

contract DigitalEvidenceContract {

    uint256 public nextId=0; //contador registros

    constructor(){
        createEvidence("Estudiante","Codigo", 123, 
            "Pepito", "Perez", 456, 
            "p@p.co", "01/01/2000");
    }

    struct DataEvidence{
        uint256 id;
        string typeUser;
        string typeIde;
        uint256 identification;
        string names;
        string lastNames;
        uint256 phone;
        string email;
        string dateRequest;
        uint256 timeBlock;
        bool verified;
        }

    mapping (uint256 => DataEvidence) public recordsEvidence;

    //evidence add records
    event createdED(
        uint256 id,
        string typeUser,
        string typeIde, uint256 identification,
        string names, string lastNames,
        uint256 phone, string email,
        string dateRequest,
        uint256 timeBlock,
        bool verified
    );
//event verified state
event statusED(uint256 id, bool status);
//------------------------------------------------------
//-- create user
    function createEvidence(
        string memory _typeUser,
        string memory _typeIde,
        uint256 _identification,
        string memory _names,
        string memory _lastNames,
        uint256 _phone,
        string memory _email,
        string memory _dateRequest
        ) public{
            // Validate input data
            require(bytes(_typeUser).length > 0, "TypeUser cannot be empty");
            require(bytes(_typeIde).length > 0, "TypeIde cannot be empty");
            require(_identification > 0, "Identification must be greater than 0");
            require(bytes(_names).length > 0, "Names cannot be empty");
            require(bytes(_lastNames).length > 0, "LastNames cannot be empty");
            require(_phone > 0, "Phone must be greater than 0");
            require(bytes(_email).length > 0, "Email cannot be empty");
            require(bytes(_dateRequest).length > 0, "DateRequest cannot be empty");

            recordsEvidence[nextId] = DataEvidence(
                nextId, _typeUser, _typeIde,
                _identification, _names, 
                _lastNames, _phone, 
                _email, _dateRequest,
                block.timestamp, false);
            nextId++;  
            //call event
            emit createdED(nextId, _typeUser, _typeIde,
                _identification, _names, 
                _lastNames, _phone, 
                _email, _dateRequest,
                block.timestamp, false);          
    }
//update state user
    function changeStatus(uint256 _id) public{
        DataEvidence memory _recordE = recordsEvidence[_id];//obtener registro
        _recordE.verified = !_recordE.verified;//cambiar estado
        recordsEvidence[_id].verified = _recordE.verified; //actualizar estado registro
        emit statusED(_id, _recordE.verified);//event
    }
    //sin uso
    function getId() public view returns (uint256) {
        return recordsEvidence[nextId-1].id;
    }
}
